import styled from "styled-components";
import Layout from "../layout/Basic";

const Title = styled.h1`
  color: red;
`;

const App = () => {
  return (
    <Layout>
      <p>hello</p>
      <Title>Title</Title>
    </Layout>
  );
};

export default App;
